import React from 'react'

export default function Research() {
  return (
    <>
        <div className="dropdown-menu">
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("Philo");
                      hiddenLink[0] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 0;
                    }}
                    hidden={hiddenLink[0]}
                  >
                    Philo
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("LLCE");
                      hiddenLink[1] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 1;
                    }}
                    hidden={hiddenLink[1]}
                  >
                    LLCE
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("HGGSP");
                      hiddenLink[2] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 2;
                    }}
                    hidden={hiddenLink[2]}
                  >
                    HGGSP
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("SES");
                      hiddenLink[3] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 3;
                    }}
                    hidden={hiddenLink[3]}
                  >
                    SES
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("NSI");
                      hiddenLink[4] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 4;
                    }}
                    hidden={hiddenLink[4]}
                  >
                    NSI
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("Maths");
                      hiddenLink[5] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 5;
                    }}
                    hidden={hiddenLink[5]}
                  >
                    Maths
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("Physique");
                      hiddenLink[6] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 6;
                    }}
                    hidden={hiddenLink[6]}
                  >
                    Physique
                  </a>
                  <a
                    className="dropdown-item"
                    onClick={() => {
                      setOption1("SVT");
                      hiddenLink[7] = true;
                      hiddenLink[currentLinkUse[0]] = false;
                      currentLinkUse[0] = 7;
                    }}
                    hidden={hiddenLink[7]}
                  >
                    SVT
                  </a>
                </div>
    </>
  )
}
